function [a, b, c, d, f0]=read_tsbecal_mmp(sensorid, calid)% read_tsbecal_mmp%   Usage:%      [a, b, c, d, f0]=read_tsbecal_mmp(sensorid, calid);%         sensorid is string with serial no for SeaBird temp%         calid is string identifying which calibration to use%         a,b,c,d,f0 are calibration numbers%   Function:%      Read calibration coef for Sea-Bird temperature.mmpfolders;source_file=[mmpdatabase filesep 'cal' filesep 'tsbe' filesep sensorid];fid=fopen(source_file,'r');if (fid <= 2)	msg=['read_tsbecal_mmp: file missing for sensorid=' sensorid ...	     ' and calid=' calid];	disp(msg)	test=0;else 	test=1;	while test==1		id=fscanf(fid,'%s',1);		a=fscanf(fid,'%s',1);		b=fscanf(fid,'%s',1);		c=fscanf(fid,'%s',1);		d=fscanf(fid,'%s',1);		f0=fscanf(fid,'%s',1);		if isempty(id)==1			msg=['read_tsbecal_mmp: calid=' calid ' not found in ' ...			     'cal file for ' sensorid];			disp(msg)			break		elseif strcmp(id,calid)==1			test=2;			break		end	endendfclose(fid);if test==2	a=str2num(a); b=str2num(b); c=str2num(c);	d=str2num(d); f0=str2num(f0);end